import dynamic from 'next/dynamic'



export function LocalPage(props) {
  return <Transfer {...props} />
}

export const getServerSideProps = async (ctx) => {
    const transfer = await import('mf_transfer/prueba')

    if (transfer.getServerSideProps) {
      return transfer.getServerSideProps(ctx)
    }

    return {
      props: {},
    }
  }
